$(document).ready( function () {
    var nSatzNr={{ GetVal1() }};
    ogrid =     $('#example').DataTable({
        "responsive": {
            'details': {
                'type': 'column'
            },
        },
        "ajax": "dataseamap.prg",
        "scrollCollapse": true,
        "paging":         true,
        "keys": {
            keys: [ 13 /* ENTER */, 38 /* UP */, 40 /* DOWN */ ]
        },
        initComplete: function () {
            $('#example_filter label input').focus();   // Focus auf die Search Box
        },
        "columns": [
        { "data": "recnumber" },
        { "data": "linkname" },
        { "data": "linkdest" },
        { "data": "longText"  },
        { "data": "longText"  },
        { "data": "" }
        ],
        "columnDefs": [
        { targets: [4], visible: false},
        {
            'orderable': false,
            'className': 'select-checkbox',
            'targets':   0
        },
        {
            'orderable': false,
            "targets": -1,     // Last column or number column "Action" is: 4 ( init at 0 -&gt; 5 )
            "data": null,
            "defaultContent": "&lt;button class='btn btn-success' id='myButton' onclick='edit( this )' style='margin-bottom:2px;padding-right:6px'&gt;&lt;i class='fas fa-edit'&gt;&lt;/i&gt;&lt;/button&gt;"
        } ],
        "select": {
            'style':    'os',
            'selector': 'td:first-child'
        },
        "order": [[ 1, 'asc' ]]
    });
    
    startseite();
    
});

function startseite(){
    alert('f');
    // 20 only for testing
    ogrid.page( 20 ).draw( 'page' );
    $('#example').DataTable().ajax.reload( null, false );
};

